Defendant in custody on WRIT.   
State moves to delete the penalty enhancers on counts 2 & 3, 2nd or subsequent offense.   Motion granted.    
Count 2 - Deliver Heroin - No contest plea.  
Count 3 - Deliver Heroin - No contest plea.   Convicted.    State moves to dismiss and read in counts 1, 4, and 5.   Motion granted.  Count 2 - Defendant is sentenced to the Wisconsin State Prison System for a total sentence of three (3) years.   Eighteen (18) months initial confinement, followed by eighteen (18) months extended supervision consecutive to 12 CF 35.   Conditions of extended supervision are:
1) Reimburse Metro Drug Unit $450.00 buy money;
2) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
3) Maintain absolute sobriety; 
4) Submit to random urine screens and pay for same; 
5) Use only one doctor for prescriptions and only one pharmacy; 
6) Maintain full-time employment/job search/schooling combination; 
7) Have no association with any know drug users or dealers;
8) Pay costs of action;
9) Pay supervision fees in an amount to be determined by DOC;
10) Submit DNA sample and pay surcharge.  
Court finds the defendant is eligible for the Challenge Incarceration Program and for the Substance Abuse Program.   
Count 3 - Defendant is sentenced to the Wisconsin State Prison System for a total sentence of three (3) years.   Eighteen (18) months initial confinement followed by eighteen (18) months extended supervision consecutive to count 2 and consecutive to 12 CF 35.   Conditions of extended supervision are the same as above.   
Minutes.
